PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX rh: <http://rdf.rhea-db.org/>
SELECT ?label
WHERE {
  rh:DirectionalReaction rdfs:label ?label .
}

PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX rh: <http://rdf.rhea-db.org/>
SELECT ?comment
WHERE {
  <http://rdf.rhea-db.org/Reaction> rdfs:comment ?comment .
}

PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX rh: <http://rdf.rhea-db.org/>
SELECT ?label
WHERE {
  <http://rdf.rhea-db.org/Polymer> rdfs:label ?label .
}

PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX rh: <http://rdf.rhea-db.org/>

SELECT ?label
WHERE {
  <http://rdf.rhea-db.org/GenericPolynucleotide> rdfs:label ?label .
}

PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX rh: <http://rdf.rhea-db.org/>

SELECT ?comment
WHERE {
  <http://rdf.rhea-db.org/ReactivePart> rdfs:comment ?comment .
}

PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX rh: <http://rdf.rhea-db.org/>
SELECT ?label
WHERE {
  <http://rdf.rhea-db.org/Status> rdfs:label ?label .
}

PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
SELECT ?label ?comment
WHERE {
  <http://rdf.rhea-db.org/Location> rdfs:comment ?comment .
  <http://rdf.rhea-db.org/Location> rdfs:label ?label .
}

PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX rhea: <http://rdf.rhea-db.org/GenericSmallMolecule>

SELECT ?label
WHERE {
  rhea: rdfs:label ?label .
}

PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX rh: <http://rdf.rhea-db.org/>

SELECT ?label 
WHERE {
  <http://rdf.rhea-db.org/GenericHeteropolysaccharide> rdfs:label ?label .
}
